import React, { Component } from "react";

class Murals extends Component{

    allMurals = () => {
        return this.props.murals.map(mural => {
            mural.id
        })
    }

    render(){
        return(
            <div>

                <h1>Murals Component</h1>

                {this.allMurals()}
            </div>
        )
    }
}

export default Murals
